export default function ContactMsg() {
    return (
        <p className="contactParagraph">This small project was made by me, Aleksandre Kobaidze in 2023. At the time of writing this I am on the 3rd year of my bachelor's degree. An interested in
            blockchain development has inspired me to learn solidity and web3.js, this project is a combination of all of the things I have managed to learn so far. If you're impressed
            by what you have seen you can always contact me on linkedIn or my personal email : publica.k@protonmail.com
        </p>
    )
}
